@-moz-document domain("roblox.com") {
@keyframes rainbow {
   0% {background-color: #6492e7;border-color: #6492e7;}
	10% {background-color: #6492e7;border-color: #6492e7;}
  20% {background-color: #6492e7;border-color: #6492e7;}
